const LineRedHorr = () => {
  return (
    <div className="lineRedHorr">
      <svg>
        <line x1="0" y1="0" x2="800" y2="0" stroke-width="2" stroke="#7e0000" />
      </svg>
    </div>
  )
}

export default LineRedHorr
